import React from "react";


function bottomBar() {
    return ( 
        <div className = "bottomBar">
            <p>Kingdom Hearts III</p>
            <p>The Walking Dead</p>
            <p>God of War</p>
            <p>Marvel's The Avenger's: In</p>
        </div>
    );
}

export default bottomBar;
